import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      <header>My Todo</header>
      <nav></nav>
      {/* Todo 생성 Form */}
      <section>
        <form>
          <p>
            <input />
          </p>
          <input />
          <button>Add</button>
        </form>
      </section>
      {/* Todo active, done section */}
      <section>
        <h4>Active</h4>
        <h4>Done</h4>
      </section>
      <footer>Copyright : 휘인</footer>
    </div>
  );
}

export default App;
